DROP TABLE IF EXISTS `sys_file`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `sys_file` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `filename` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '附件名称',
  `extension` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '附件后缀',
  `filepath` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '附件地址',
  `type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '附件类型[图片，文件]',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  KEY `sys_file_del_flag` (`del_flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
/*!40101 SET character_set_client = @saved_cs_client */;

